import { render } from '@testing-library/react';
import { AccessAlarm, ThreeDRotation } from '@material-ui/icons';
import AddBoxIcon from '@material-ui/icons/AddBox';
import React from 'react';
import {Link, useHistory} from 'react-router-dom'
import { withRouter } from 'react-router-dom';
import axios from 'axios';
import { RssFeed } from '@material-ui/icons';

class NewP extends React.Component{
    state={
        name:"",
        description:""
    }
    handlechange = (event)=>{
        this.setState({
            [event.target.name]: event.target.value
        })
    }
    render(){
        return(
            <div style={{maxWidth:"550px", margin:"0px auto"}} class="row">
    <div class="col s12 m6">
      <div class="card blue-grey darken-1">
        <div class="card-content white-text">
          <span class="card-title">Product</span>
          <p> <div class="row">
          <form class="col s12"> 
          <div class="row">
          <div class="input-field col s6">
          <input id="input_text" type="text" onChange ={this.handlechange} name = "name" data-length="10"/>
          <label for="input_text">Product Name</label>
          </div>
          </div>
          <div class="row">
          <div class="input-field col s12">
            <textarea id="textarea2" onChange ={this.handlechange} name = "description" class="materialize-textarea" data-length="120"></textarea>
            <label for="textarea2">Description</label>
          </div>
        </div>
          </form>
    
          </div></p>
        </div>
        <div class="card-action">
        <button class="btn waves-effect waves-light" type="submit" name="action">Add Product
        <i style ={{position: "absolute"}}class="material-icons font-size: 50px">add_circle
        </i>
  </button>
        </div>
      </div>
    </div>
  </div>
           
        )
    }
}
export default withRouter(NewP)
